import HeaderBarTitle from "./HeaderBarTitle";

interface HeaderBarProps {
    readonly headerIcon: any;
}

export default function HeaderBar({
    headerIcon,
}: HeaderBarProps) {
    return (
        <div>
            <HeaderBarTitle
                icon={headerIcon}
            />
        </div>
    );
}
